import React from "react";
import Header from "../../../components/Header";
import '../../../styles/dashboard/index.css'

class BaseDashboard extends React.Component{

      render(){
          return(
              <div>
                  <Header />
                     {this.props.children}
              </div>
          );
      }
}

export default BaseDashboard;
